import "./style.css"

export const Price = ({ listTransactions }) => {

    function priceSome() {

        const lista = listTransactions

        const preco = lista.forEach((cadastros) => {
            return cadastros.valor
        })

        console.log(preco)
    }

    priceSome()

    return (
        <div className="containerPrice">
            <div className="priceAll">
                <h2>Valor total:</h2>
                <span>O valor se refere as entradas</span>
            </div>

            <span className="price">$1000</span>

        </div>
    )
}
